    <style id='shiftup-style-inline-css' type='text/css'>
        #qodef-page-outer {
            margin-top: -100px;
        }

        @media only screen and (max-width: 1024px) {
            #qodef-page-outer {
                margin-top: -70px;
            }
        }

        #qodef-page-footer-top-area {
            border-top-color: #000000;
            border-top-width: 5px;
            border-top-style: solid;
        }

        #qodef-page-inner {
            padding: 0px;
        }

        @media only screen and (max-width: 1024px) {
            #qodef-page-inner {
                padding: 0px;
            }
        }

        #qodef-top-area {
            background-color: #000000;
        }

        #qodef-top-area-inner {
            height: 40px;
        }

        #qodef-page-mobile-header .qodef-mobile-header-logo-link {
            height: 17px;
        }

        #qodef-page-mobile-header .qodef-mobile-header-logo-link.qodef-source--svg-path svg {
            width: 150px;
        }

        .qodef-page-title {
            height: 111px;
            background-color: #f3f3f3;
        }

        .qodef-page-title .qodef-m-content {
            padding-top: 100px;
        }

        @media only screen and (max-width: 1024px) {
            .qodef-page-title .qodef-m-content {
                padding-top: 70px;
            }
        }

        .qodef-header--standard #qodef-page-header {
            background-color: rgba(255, 255, 255, 0);
        }

        .qodef-header--standard #qodef-page-header-inner {
            padding-left: 50px;
            padding-right: 50px;
        }

        .qodef-mobile-header--standard #qodef-page-mobile-header-inner:not(.qodef-content-grid) {
            padding-left: 7%;
            padding-right: 7%;
        }

        .qodef-mobile-header--standard .qodef-mobile-header-navigation > ul:not(.qodef-content-grid) {
            padding-left: 7%;
            padding-right: 7%;
        }

        @media only screen and (max-width: 768px) {
            h2,
            .qodef-h2 {
                font-size: 39px;
            }
        }

        @media only screen and (max-width: 680px) {
            h1,
            .qodef-h1 {
                font-size: 60px;
            }

            h2,
            .qodef-h2 {
                font-size: 40px;
            }
        }
